//Center of player's fort is currently at X=13-14, Y=17-18 in "tile space"

class LevelActions {
    construct new() {
        _isMortarAssemblyBeingDestroyed = false
    }

    isMortarAssemblyBeingDestroyed { _isMortarAssemblyBeingDestroyed }

    static bombardment(minX, maxX, minY, maxY) {
        var bombsPerSecond = 2.0
        var timerIncrement = 1.0/bombsPerSecond
            for (y in minY..maxY) {
                for (x in minX..maxX) {
                    Event.timer(((maxY - y)*(maxX - minX) + (maxX - x))*timerIncrement, false, Fn.new{
                        Cmd.attack("siege_mortar_shell", 54.0*24.0, 17.0*24.0, 0.0, x*24.0, y*24.0, 0.0)
                    })
                }
            }
    }

    destroyMortarAssembly() {
        if (_isMortarAssemblyBeingDestroyed) return

        _isMortarAssemblyBeingDestroyed = true
        Cmd.demolish(53,17)
        Cmd.demolish(53,18)
        Cmd.demolish(54,17)
        Cmd.demolish(54,18)

        Cmd.dialog("Nooooooooo! Our beautiful weapon, lost forever!!")
        Cmd.dialog("There's nothing left to defend here... we surrender.")
        Cmd.win("left")
    }
}
var la = LevelActions.new()

Cmd.dialog("Your pitiful fort will stand no chance against our awesome secret weapon!")

Event.teamHealthBelow("right", 0.90, Fn.new {
    Cmd.dialog("So you've reached our nests... so be it! Bombs away!")
    //destroy a small (4x4) central area in the player's fort
    //2.5 per second seems like a good speed
    LevelActions.bombardment(13, 14, 17, 18)
})

Event.teamHealthBelow("right", 0.70, Fn.new {
    Cmd.dialog("Time for a second volley, men!")
    //destroy a medium (6x6) central area in the player's fort
    LevelActions.bombardment(12, 15, 16, 19)
})

Event.teamHealthBelow("right", 0.50, Fn.new {
    Cmd.dialog("We're on the ropes now... let's give them everything we've got!")
    //destroy a large (8x8) central area in the player's fort
    LevelActions.bombardment(11, 16, 15, 20)
})

var wrapper = Fn.new { la.destroyMortarAssembly() }
Event.structureDestroyed(53, 17, wrapper)
Event.structureDestroyed(53, 18, wrapper)
Event.structureDestroyed(54, 17, wrapper)
Event.structureDestroyed(54, 18, wrapper)
